少し時間ができたので、﻿
お金を稼げる人と稼げない人には﻿
どのような差があるのか。﻿
﻿
ちょこっと書かせてもらいます。﻿
﻿
﻿
結論から言ってしまいますと、﻿
﻿
﻿
「お金持ちはお金を払って時間を買う。﻿
貧乏人は時間を売ってお金を稼ぐ。」﻿
﻿
﻿
これはもうお金を稼いでいる方からすれば﻿
何を当たり前なことをと思うかもしれませんね。﻿
﻿
﻿
ただこの意味をちゃんと理解し、﻿
腹落ちさせて行動に移せている人は﻿
ごく僅かだと思います。﻿
﻿
﻿
よくある謳い文句で、﻿
﻿
﻿
「アルバイト(時給制)しながら接客マナーが身につけられる！お金を稼ぎながら学べる！」﻿
﻿
などがあるかと思います。﻿
﻿
﻿
すべて否定するわけではありませんが、﻿
﻿
