時給で働いている限り﻿
「足し算」でお金を稼いでいるのです。﻿
﻿
﻿
それは、稼げるお金の限界を﻿
意味しています。﻿
﻿
﻿
すでに成功している方は﻿
足し算ではなく、「掛け算」で稼いでいます。﻿
﻿
﻿
ではどのような仕事が﻿
掛け算での稼ぎ方なのか。﻿
﻿
﻿
例をあげたいと思いましたが、﻿
文章が長くなってしまったので﻿
続きは次回にしたいと思います。﻿
﻿
﻿
ここまで読んで頂いた方々﻿
ありがとうございます。﻿
﻿
﻿
たまに、こういった﻿
どういう思考で行動して﻿
お金を稼いでいるのか。﻿
﻿
﻿
お金を稼ぐとはどういうことなのか﻿
あくまで個人的な見解ではありますが﻿
投稿したいと思います。﻿
